import ReactDOM from 'react-dom';

function Cards(){
  return(
    <>
      <div className="Card">
        <img src="https://images-na.ssl-images-amazon.com/images/M/MV5BMjEzMDAxOTUyMV5BMl5BanBnXkFtZTgwNzAxMzYzOTE@._V1_.jpg"
          width="200px" height="300px"
        />
      </div>
    </>
  )
}
export default Cards;
